#!/usr/bin/env python
# encoding: utf-8


class Solution(object):
    def findTheDifference(self, s, t):
        """
        :type s: str
        :type t: str
        :rtype: str
        """
        s_list = list(s)
        t_list = list(t)
        s_list.sort()
        t_list.sort()
        for i in range(len(s)):
            if s_list[i] != t_list[i]:
                return t_list[i]
        return t_list[-1]


if __name__ == '__main__':
    s = Solution()
    s1 = ""
    t = ""
    print(s.findTheDifference(s1, t))
